import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://krcrtv.com/resources/media/503f0652-d5c4-4386-af22-d57c5a11b4d2-large16x9_GettyImages1221259505.jpg?1595288133116" />
      </header>
    </div>
  );
}

export default App;
